Сынақ лицензиясы тек келесі мақсаттар үшін беріледі: 

І. Ішкі бағалау. Бұл лицензия тек ішкі пайдалануға арналған және өндірістік лицензия болып табылмайды, сондықтан оны толығымен не қандай да бір бөлігін таратуға немесе кез келген коммерциялық өнімге қосуға болмайды.

II. Көрсету. Ішкі бағалаудан бөлек, бұл лицензия тек маркетингілік мақсатта үшінші тұлғаларға сол күйінде көрсету үшін пайдалануға арналған. Бұл лицензияны iWedia бәсекелестерімен қандай да бір жолмен пайдалануға қатаң тыйым салынады.

Келесілерге тыйым салынады:

I. Live TV қолданбасын қосалқы лицензиялауға, пайдалануға, өзгертуге немесе одан кез келген туынды жұмыстар жасауға, соның ішінде қолданбаға қатысты кез келген құжаттама жасауға;

II. кері компиляциялауға, кері инжинирингіге, бөлшектеуге, қайта форматтауға, үлгі ретінде пайдалануға немесе Live TV қолданбасының нысандық кодын немесе бастапқы кодын (не негізгі идеяларды, алгоритмдерді, құрылымды, ұйымдастырылу ретін) толығымен не ішінара оқуға әрекеттенуге немесе оқылатындай басқа әрекеттер жасауға;

III. Live TV қолданбасын өзгертуге немесе бағдарламалық құрал негізінде кез келген туынды жұмысты жасауға;

IV. жалға беруге, лизингіге, сатуға, қосалқы лицензиялауға, кепілзат ретінде ауыртпалық салуға немесе Live TV қолданбасына кез келген құқықты басқа жолмен беруге;

V. Live TV қолданбасындағы кез келген белгілерді, меншік туралы хабарландыруларды немесе жапсырмаларды өшіруге немесе өзгертуге;

VI. Live TV қолданбасын кез келген үшінші тараптың зияткерлік меншігін немесе жеке өмір құқығын бұзатын кез келген жолмен пайдалануға; немесе

VII. Live TV қолданбасын кез келген қолданыстағы халықаралық, федералдық, штаттық немесе жергілікті заңдарды немесе ережелерді бұзатын кез келген жолмен пайдалануға.

Live TV қолданбасына қатысты барлық зияткерлік меншік құықығы мен мүліктік құқық, барлық мүдде iWedia иелігінде қалады.

